import React, { Component } from "react";

class MuralCard extends Component{
    render(){
        console.log(this.props.mural)
        return(
            <div>
                <p>{this.props.mural.mural_title}</p>
                <p>{this.props.mural.year_installed}</p>
            </div>
        )
    }
}
export default MuralCard
